                        {/*</td>*/}
                        {/*<td>*/}
                        {/*    <button className="btn btn-success" onClick={() => this.updateCourseClicked(course.id)}>Update</button>*/}
                        {/*</td>*/}
                    </tr>
            )
        );
    }
}

export default StudentProjectList;
